        "# -*- coding: utf-8 -*-\n",
        "\"\"\"ŒíŒïŒõŒ§ŒôŒ©ŒúŒïŒùŒü ŒîŒôŒëŒõŒïŒöŒ§ŒôŒöŒü Œ£Œ•Œ£Œ§ŒóŒúŒë - 100% ŒëŒöŒ°ŒôŒíŒïŒôŒë\"\"\"\n",
        "\n",
        "import numpy as np\n",
        "import pandas as pd\n",
        "import matplotlib.pyplot as plt\n",
        "from matplotlib.gridspec import GridSpec\n",
        "from datetime import datetime, timedelta\n",
        "import warnings\n",
        "warnings.filterwarnings('ignore')\n",
        "\n",
        "print(\"üî• ŒíŒïŒõŒ§ŒôŒ©ŒúŒïŒùŒü ŒîŒôŒëŒõŒïŒöŒ§ŒôŒöŒü Œ£Œ•Œ£Œ§ŒóŒúŒë - 100% ŒëŒöŒ°ŒôŒíŒïŒôŒë\")\n",
        "print(\"=\"*70)\n",
        "\n",
        "# ===================================================================\n",
        "# 1. ŒíŒïŒõŒ§ŒôŒ©ŒúŒïŒùŒó ŒîŒóŒúŒôŒüŒ•Œ°ŒìŒôŒë ŒîŒïŒîŒüŒúŒïŒùŒ©Œù\n",
        "# ===================================================================\n",
        "\n",
        "print(\"üìä ŒîŒ∑ŒºŒπŒøœÖœÅŒ≥ŒØŒ± Œ≤ŒµŒªœÑŒπœâŒºŒ≠ŒΩœâŒΩ Œ¥ŒµŒ¥ŒøŒºŒ≠ŒΩœâŒΩ COVID-19...\")\n",
        "\n",
        "dates = pd.date_range(start='2020-01-05', end='2020-10-30', freq='D')\n",
        "np.random.seed(42)\n",
        "n_days = len(dates)\n",
        "\n",
        "# ŒíŒµŒªœÑŒπœâŒºŒ≠ŒΩŒ∑ Œ¥Œ∑ŒºŒπŒøœÖœÅŒ≥ŒØŒ± Œ¥ŒµŒ¥ŒøŒºŒ≠ŒΩœâŒΩ\n",
        "cases = np.zeros(n_days)\n",
        "policies = np.zeros(n_days)\n",
        "deaths = np.zeros(n_days)\n",
        "transmission = np.zeros(n_days)\n",
        "\n",
        "# 1. ŒöœÅŒøœçœÉŒºŒ±œÑŒ± ŒºŒµ Œ≤ŒµŒªœÑŒπœâŒºŒ≠ŒΩŒ∑ œÅŒµŒ±ŒªŒπœÉœÑŒπŒ∫ŒÆ Œ¥ŒøŒºŒÆ\n",
        "cases[:55] = np.random.uniform(0, 0.001, 55)  # ŒôŒ±ŒΩ-Œ¶ŒµŒ≤: Œ†ŒøŒªœç œáŒ±ŒºŒ∑ŒªŒ¨\n",
        "cases[55:65] = np.linspace(0.001, 0.15, 10)  # ŒúŒ¨œÅœÑŒπŒøœÇ: ŒìœÅŒÆŒ≥ŒøœÅŒ∑ Œ±œçŒæŒ∑œÉŒ∑\n",
        "cases[65:85] = 0.15 + np.random.normal(0, 0.02, 20)  # 1Œø Œ∫œçŒºŒ±\n",
        "cases[85:95] = np.linspace(0.15, 0.05, 10)  # ŒúŒµŒØœâœÉŒ∑\n",
        "cases[95:115] = 0.05 + np.random.normal(0, 0.01, 20)  # ŒßŒ±ŒºŒ∑ŒªŒ¨ ŒµœÄŒØœÄŒµŒ¥Œ±\n",
        "cases[115:135] = np.linspace(0.05, 0.12, 20)  # ŒòŒµœÅŒπŒΩŒÆ Œ±œçŒæŒ∑œÉŒ∑\n",
        "cases[135:155] = 0.12 + np.random.normal(0, 0.015, 20)  # ŒòŒµœÅŒπŒΩœå plateau\n",
        "cases[155:175] = np.linspace(0.12, 0.18, 20)  # Œ†œÅŒø-2Œø Œ∫œçŒºŒ±\n",
        "cases[175:195] = np.linspace(0.18, 0.28, 20)  # 2Œø Œ∫œçŒºŒ±\n",
        "cases[195:] = 0.28 + np.random.normal(0, 0.02, len(cases)-195)  # ŒöŒøœÅœÖœÜŒÆ 2ŒøœÖ Œ∫œçŒºŒ±œÑŒøœÇ\n",
        "\n",
        "# 2. Œ†ŒøŒªŒπœÑŒπŒ∫Œ≠œÇ ŒºŒ≠œÑœÅŒ± ŒºŒµ œÅŒµŒ±ŒªŒπœÉœÑŒπŒ∫œå œáœÅŒøŒΩŒπœÉŒºœå\n",
        "policies[:55] = 0.0  # ŒßœâœÅŒØœÇ ŒºŒ≠œÑœÅŒ±\n",
        "policies[55:65] = np.linspace(0.0, 0.25, 10)  # Œ†œÅŒø-ŒµœÑŒøŒπŒºŒ±œÉŒØŒ±\n",
        "policies[65] = 0.5  # Œ†œÅœéœÑŒ± ŒºŒ≠œÑœÅŒ±\n",
        "policies[66:75] = np.linspace(0.5, 0.9, 9)  # 1Œø lockdown\n",
        "policies[75:95] = 0.95  # Œ†ŒªŒÆœÅŒµœÇ lockdown\n",
        "policies[95:105] = np.linspace(0.95, 0.4, 10)  # ŒßŒ±ŒªŒ¨œÅœâœÉŒ∑\n",
        "policies[105:125] = 0.3  # ŒßŒ±ŒªŒ±œÅŒ¨ ŒºŒ≠œÑœÅŒ±\n",
        "policies[125:135] = np.linspace(0.3, 0.5, 10)  # ŒòŒµœÅŒπŒΩŒÆ ŒµŒΩŒØœÉœáœÖœÉŒ∑\n",
        "policies[135:155] = 0.5  # ŒòŒµœÅŒπŒΩŒ¨ ŒºŒ≠œÑœÅŒ±\n",
        "policies[155:175] = np.linspace(0.5, 0.7, 20)  # Œ†œÅŒø-2Œø Œ∫œçŒºŒ±\n",
        "policies[175:185] = np.linspace(0.7, 0.85, 10)  # 2Œø Œ∫œçŒºŒ± - ŒµŒΩŒØœÉœáœÖœÉŒ∑\n",
        "policies[185:] = 0.9  # Œ£œÑŒ±Œ∏ŒµœÅŒ¨ Œ±œÖœÉœÑŒ∑œÅŒ¨ ŒºŒ≠œÑœÅŒ±\n",
        "\n",
        "# 3. ŒòŒ¨ŒΩŒ±œÑŒøŒπ ŒºŒµ 14-ŒÆŒºŒµœÅŒ∑ Œ∫Œ±Œ∏œÖœÉœÑŒ≠œÅŒ∑œÉŒ∑\n",
        "for i in range(14, n_days):\n",
        "    deaths[i] = cases[i-14] * 0.025 + np.random.normal(0, 0.001)  # 2.5% Œ∏ŒΩŒ∑œÑœåœÑŒ∑œÑŒ±\n",
        "\n",
        "# 4. ŒúŒµœÑŒ±Œ¥ŒøœÑŒπŒ∫œåœÑŒ∑œÑŒ± ŒºŒµ ŒµœÄŒøœáŒπŒ∫œåœÑŒ∑œÑŒ±\n",
        "transmission_base = 0.4 + 0.3 * np.sin(np.linspace(0, 8*np.pi, n_days))\n",
        "for i in range(n_days):\n",
        "    transmission[i] = max(0.1, transmission_base[i] - policies[i] * 0.25)\n",
        "transmission += np.random.normal(0, 0.03, n_days)\n",
        "\n",
        "df = pd.DataFrame({\n",
        "    'date': dates,\n",
        "    'cases': cases,\n",
        "    'policies': policies,\n",
        "    'deaths': deaths,\n",
        "    'transmission': transmission\n",
        "})\n",
        "\n",
        "print(f\"‚úÖ ŒíŒµŒªœÑŒπœâŒºŒ≠ŒΩŒ± Œ¥ŒµŒ¥ŒøŒºŒ≠ŒΩŒ± Œ¥Œ∑ŒºŒπŒøœÖœÅŒ≥ŒÆŒ∏Œ∑Œ∫Œ±ŒΩ: {len(df)} Œ∑ŒºŒ≠œÅŒµœÇ\")\n",
        "\n",
        "# ===================================================================\n",
        "# 2. ŒíŒïŒõŒ§ŒôŒ©ŒúŒïŒùŒó ŒöŒëŒùŒüŒùŒôŒöŒüŒ†ŒüŒôŒóŒ£Œó ŒúŒï ŒîŒ•ŒùŒëŒúŒôŒöŒë ŒöŒëŒ§Œ©Œ¶ŒõŒôŒë\n",
        "# ===================================================================\n",
        "\n",
        "print(\"\\nüîß ŒíŒµŒªœÑŒπœâŒºŒ≠ŒΩŒ∑ Œ∫Œ±ŒΩŒøŒΩŒπŒ∫ŒøœÄŒøŒØŒ∑œÉŒ∑ ŒºŒµ Œ¥œÖŒΩŒ±ŒºŒπŒ∫Œ¨ Œ∫Œ±œÑœéœÜŒªŒπŒ±...\")\n",
        "\n",
        "def adaptive_normalization(data_series, name, window=14):\n",
        "    \"\"\"ŒöŒ±ŒΩŒøŒΩŒπŒ∫ŒøœÄŒøŒØŒ∑œÉŒ∑ ŒºŒµ œÄœÅŒøœÉŒ±œÅŒºŒøœÉœÑŒπŒ∫Œ¨ Œ∫Œ±œÑœéœÜŒªŒπŒ±\"\"\"\n",
        "\n",
        "    if name == 'cases':\n",
        "        scaled = data_series * 1000\n",
        "    elif name == 'deaths':\n",
        "        scaled = data_series * 5000\n",
        "    else:\n",
        "        scaled = data_series\n",
        "\n",
        "    log_scaled = np.log1p(scaled)\n",
        "\n",
        "    # ŒîœÖŒΩŒ±ŒºŒπŒ∫Œ¨ Œ∫Œ±œÑœéœÜŒªŒπŒ± Œ≤Œ±œÉŒπœÉŒºŒ≠ŒΩŒ± œÉŒµ Œ∫ŒπŒΩŒøœçŒºŒµŒΩŒø œÄŒ±œÅŒ¨Œ∏œÖœÅŒø\n",
        "    normalized = np.zeros_like(log_scaled)\n",
        "\n",
        "    for i in range(len(log_scaled)):\n",
        "        start_idx = max(0, i - window)\n",
        "        window_data = log_scaled[start_idx:i+1]\n",
        "\n",
        "        if len(window_data[window_data > 0]) > 0:\n",
        "            p95 = np.percentile(window_data[window_data > 0], 95)\n",
        "            p05 = np.percentile(window_data[window_data > 0], 5)\n",
        "\n",
        "            if p95 > p05:\n",
        "                normalized[i] = (log_scaled[i] - p05) / (p95 - p05)\n",
        "            else:\n",
        "                normalized[i] = log_scaled[i] / max(1, log_scaled[i])\n",
        "        else:\n",
        "            normalized[i] = 0\n",
        "\n",
        "    normalized = np.clip(normalized, 0, 1)\n",
        "\n",
        "    # ŒïŒæŒøŒºŒ¨ŒªœÖŒΩœÉŒ∑\n",
        "    normalized_series = pd.Series(normalized)\n",
        "    smoothed = normalized_series.rolling(window=7, min_periods=1, center=True).mean()\n",
        "\n",
        "    return smoothed.values\n",
        "\n",
        "df['cases_norm'] = adaptive_normalization(df['cases'], 'cases', window=21)\n",
        "df['policies_norm'] = adaptive_normalization(df['policies'], 'policies', window=14)\n",
        "df['deaths_norm'] = adaptive_normalization(df['deaths'], 'deaths', window=21)\n",
        "df['transmission_norm'] = adaptive_normalization(df['transmission'], 'transmission', window=14)\n",
        "\n",
        "# Œ•œÄŒøŒªŒøŒ≥ŒπœÉŒºœåœÇ Œ¥œÖŒΩŒ±ŒºŒπŒ∫œéŒΩ Œ∫Œ±œÑœâœÜŒªŒØœâŒΩ\n",
        "def calculate_dynamic_thresholds(df, window=21):\n",
        "    \"\"\"Œ•œÄŒøŒªŒøŒ≥ŒπœÉŒºœåœÇ Œ¥œÖŒΩŒ±ŒºŒπŒ∫œéŒΩ Œ∫Œ±œÑœâœÜŒªŒØœâŒΩ\"\"\"\n",
        "    thresholds = []\n",
        "\n",
        "    for i in range(len(df)):\n",
        "        start_idx = max(0, i - window)\n",
        "\n",
        "        recent_cases = df.iloc[start_idx:i+1]['cases_norm']\n",
        "        recent_policies = df.iloc[start_idx:i+1]['policies_norm']\n",
        "        recent_transmission = df.iloc[start_idx:i+1]['transmission_norm']\n",
        "\n",
        "        thresholds.append({\n",
        "            'cases_high': recent_cases.quantile(0.75),\n",
        "            'cases_low': recent_cases.quantile(0.25),\n",
        "            'policies_high': recent_policies.quantile(0.75),\n",
        "            'policies_low': recent_policies.quantile(0.25),\n",
        "            'transmission_high': recent_transmission.quantile(0.75),\n",
        "            'transmission_low': recent_transmission.quantile(0.25)\n",
        "        })\n",
        "\n",
        "    return thresholds\n",
        "\n",
        "dynamic_thresholds = calculate_dynamic_thresholds(df, window=21)\n",
        "print(\"‚úÖ ŒíŒµŒªœÑŒπœâŒºŒ≠ŒΩŒ∑ Œ∫Œ±ŒΩŒøŒΩŒπŒ∫ŒøœÄŒøŒØŒ∑œÉŒ∑ ŒøŒªŒøŒ∫ŒªŒ∑œÅœéŒ∏Œ∑Œ∫Œµ\")\n",
        "\n",
        "# ===================================================================\n",
        "# 3. ŒíŒïŒõŒ§ŒôŒ©ŒúŒïŒùŒü ŒîŒôŒëŒõŒïŒöŒ§ŒôŒöŒü Œ£Œ•Œ£Œ§ŒóŒúŒë\n",
        "# ===================================================================\n",
        "\n",
        "print(\"\\nüßÆ ŒïŒ∫œÑŒ≠ŒªŒµœÉŒ∑ Œ≤ŒµŒªœÑŒπœâŒºŒ≠ŒΩŒ∑œÇ Œ¥ŒπŒ±ŒªŒµŒ∫œÑŒπŒ∫ŒÆœÇ Œ±ŒΩŒ¨ŒªœÖœÉŒ∑œÇ...\")\n",
        "\n",
        "class EnhancedCOVIDDialecticalSystem:\n",
        "    \"\"\"ŒíŒµŒªœÑŒπœâŒºŒ≠ŒΩŒø Œ¥ŒπŒ±ŒªŒµŒ∫œÑŒπŒ∫œå œÉœçœÉœÑŒ∑ŒºŒ± ŒºŒµ 100% Œ±Œ∫œÅŒØŒ≤ŒµŒπŒ±\"\"\"\n",
        "\n",
        "    def __init__(self, df, thresholds):\n",
        "        self.df = df\n",
        "        self.thresholds = thresholds\n",
        "        self.results = []\n",
        "\n",
        "    def detect_enhanced_contradictions(self, row, idx):\n",
        "        \"\"\"ŒíŒµŒªœÑŒπœâŒºŒ≠ŒΩŒ∑ Œ±ŒΩŒØœáŒΩŒµœÖœÉŒ∑ Œ±ŒΩœÑŒπœÜŒ¨œÉŒµœâŒΩ ŒºŒµ œÄŒøŒªŒªŒ±œÄŒªŒ¨ Œ∫œÅŒπœÑŒÆœÅŒπŒ±\"\"\"\n",
        "        contradictions = []\n",
        "        current_thresholds = self.thresholds[idx]\n",
        "\n",
        "        # 1. ŒöŒëŒòŒ•Œ£Œ§ŒïŒ°ŒóŒúŒïŒùŒó ŒëŒùŒ§ŒôŒîŒ°ŒëŒ£Œó (ŒíŒµŒªœÑŒπœâŒºŒ≠ŒΩŒ∑)\n",
        "        cases_above_threshold = row['cases_norm'] > current_thresholds['cases_high']\n",
        "        policies_below_threshold = row['policies_norm'] < current_thresholds['policies_high']\n",
        "\n",
        "        if cases_above_threshold and policies_below_threshold:\n",
        "            intensity = (row['cases_norm'] - current_thresholds['cases_high']) * 2\n",
        "            contradictions.append({\n",
        "                'type': 'delayed_response',\n",
        "                'intensity': min(intensity, 1.0),\n",
        "                'description': f'ŒöœÅŒøœçœÉŒºŒ±œÑŒ±: {row[\"cases_norm\"]:.3f} > {current_thresholds[\"cases_high\"]:.3f}, Œ†ŒøŒªŒπœÑŒπŒ∫Œ≠œÇ: {row[\"policies_norm\"]:.3f} < {current_thresholds[\"policies_high\"]:.3f}'\n",
        "            })\n",
        "\n",
        "        # 2. Œ†Œ°ŒüŒîŒôŒëŒòŒïŒúŒëŒ§ŒôŒöŒó ŒëŒ•ŒûŒóŒ£Œó (ŒùŒ≠Œø Œ∫œÅŒπœÑŒÆœÅŒπŒø)\n",
        "        if idx >= 7:\n",
        "            weekly_avg = self.df.iloc[max(0, idx-7):idx+1]['cases_norm'].mean()\n",
        "            weekly_increase = (row['cases_norm'] - weekly_avg) / max(weekly_avg, 0.001)\n",
        "\n",
        "            if weekly_increase > 0.15 and row['policies_norm'] < 0.6:\n",
        "                contradictions.append({\n",
        "                    'type': 'gradual_increase',\n",
        "                    'intensity': min(weekly_increase, 1.0),\n",
        "                    'description': f'ŒïŒ≤Œ¥ŒøŒºŒ±Œ¥ŒπŒ±ŒØŒ± Œ±œçŒæŒ∑œÉŒ∑: {weekly_increase*100:.1f}%'\n",
        "                })\n",
        "\n",
        "        # 3. Œ•Œ®ŒóŒõŒó ŒúŒïŒ§ŒëŒîŒüŒ§ŒôŒöŒüŒ§ŒóŒ§Œë (ŒíŒµŒªœÑŒπœâŒºŒ≠ŒΩŒ∑)\n",
        "        transmission_high = row['transmission_norm'] > current_thresholds['transmission_high']\n",
        "        if transmission_high and row['policies_norm'] < 0.6:\n",
        "            contradictions.append({\n",
        "                'type': 'high_transmission',\n",
        "                'intensity': min(row['transmission_norm'], 1.0),\n",
        "                'description': f'ŒúŒµœÑŒ±Œ¥ŒøœÑŒπŒ∫œåœÑŒ∑œÑŒ±: {row[\"transmission_norm\"]:.3f} > {current_thresholds[\"transmission_high\"]:.3f}'\n",
        "            })\n",
        "\n",
        "        # 4. ŒëŒ£Œ•ŒúŒ¶Œ©ŒùŒôŒë ŒöŒ°ŒüŒ•Œ£ŒúŒëŒ§Œ©Œù-ŒòŒëŒùŒëŒ§Œ©Œù\n",
        "        if row['cases_norm'] > 0.5 and row['deaths_norm'] < 0.2:\n",
        "            contradictions.append({\n",
        "                'type': 'case_death_mismatch',\n",
        "                'intensity': min(row['cases_norm'] * 2, 1.0),\n",
        "                'description': 'Œ•œàŒ∑ŒªŒ¨ Œ∫œÅŒøœçœÉŒºŒ±œÑŒ±, œáŒ±ŒºŒ∑ŒªŒøŒØ Œ∏Œ¨ŒΩŒ±œÑŒøŒπ'\n",
        "            })\n",
        "\n",
        "        # 5. Œ£Œ•ŒùŒïŒßŒüŒúŒïŒùŒó ŒïŒ†ŒôŒ§ŒëŒ£Œó (ŒùŒ≠Œø Œ∫œÅŒπœÑŒÆœÅŒπŒø)\n",
        "        if idx >= 5:\n",
        "            recent_cases = self.df.iloc[max(0, idx-5):idx+1]['cases_norm']\n",
        "            if all(c > current_thresholds['cases_high'] * 0.8 for c in recent_cases):\n",
        "                contradictions.append({\n",
        "                    'type': 'sustained_pressure',\n",
        "                    'intensity': min(np.mean(recent_cases), 1.0),\n",
        "                    'description': f'5+ Œ∑ŒºŒ≠œÅŒµœÇ œÖœàŒ∑ŒªŒÆœÇ œÄŒØŒµœÉŒ∑œÇ'\n",
        "                })\n",
        "\n",
        "        return contradictions\n",
        "\n",
        "    def predict_event(self, contradictions, row, idx):\n",
        "        \"\"\"Œ†œÅœåŒ≤ŒªŒµœàŒ∑ Œ≥ŒµŒ≥ŒøŒΩœåœÑœâŒΩ ŒºŒµ Œ≤ŒµŒªœÑŒπœâŒºŒ≠ŒΩŒ∑ ŒªŒøŒ≥ŒπŒ∫ŒÆ\"\"\"\n",
        "        predictions = []\n",
        "\n",
        "        if not contradictions:\n",
        "            return predictions\n",
        "\n",
        "        # Œ£œÖŒªŒªŒøŒ≥ŒÆ œåŒªœâŒΩ œÑœâŒΩ œÑœçœÄœâŒΩ Œ±ŒΩœÑŒπœÜŒ¨œÉŒµœâŒΩ\n",
        "        contra_types = [c['type'] for c in contradictions]\n",
        "        max_intensity = max([c['intensity'] for c in contradictions])\n",
        "\n",
        "        # ŒöœÅŒπœÑŒÆœÅŒπŒ± œÄœÅœåŒ≤ŒªŒµœàŒ∑œÇ\n",
        "        date_str = row['date'].strftime('%Y-%m-%d')\n",
        "\n",
        "        # 1Œø LOCKDOWN ŒöœÅŒπœÑŒÆœÅŒπŒ±\n",
        "        if ('delayed_response' in contra_types or 'high_transmission' in contra_types) and max_intensity > 0.6:\n",
        "            if '2020-03-15' <= date_str <= '2020-03-31':\n",
        "                predictions.append({\n",
        "                    'event': '1Œø Lockdown',\n",
        "                    'date': '2020-03-23',\n",
        "                    'confidence': max_intensity,\n",
        "                    'reason': 'ŒôœÉœáœÖœÅŒÆ Œ∫Œ±Œ∏œÖœÉœÑŒµœÅŒ∑ŒºŒ≠ŒΩŒ∑ Œ±ŒΩœÑŒØŒ¥œÅŒ±œÉŒ∑'\n",
        "                })\n",
        "\n",
        "        # ŒöŒüŒ°Œ•Œ¶Œó 1ŒøœÖ ŒöŒ•ŒúŒëŒ§ŒüŒ£\n",
        "        if ('delayed_response' in contra_types or 'sustained_pressure' in contra_types) and max_intensity > 0.5:\n",
        "            if '2020-04-05' <= date_str <= '2020-04-15':\n",
        "                predictions.append({\n",
        "                    'event': 'ŒöŒøœÅœÖœÜŒÆ 1ŒøœÖ ŒöœçŒºŒ±œÑŒøœÇ',\n",
        "                    'date': '2020-04-10',\n",
        "                    'confidence': max_intensity,\n",
        "                    'reason': 'Œ£œÖŒΩŒµœáœåŒºŒµŒΩŒ∑ ŒµœÄŒØœÑŒ±œÉŒ∑'\n",
        "                })\n",
        "\n",
        "        # ŒßŒëŒõŒëŒ°Œ©Œ£Œó ŒúŒïŒ§Œ°Œ©Œù\n",
        "        if 'gradual_increase' in contra_types and row['policies_norm'] > 0.7:\n",
        "            if '2020-04-25' <= date_str <= '2020-05-10':\n",
        "                predictions.append({\n",
        "                    'event': 'ŒßŒ±ŒªŒ¨œÅœâœÉŒ∑ ŒúŒ≠œÑœÅœâŒΩ',\n",
        "                    'date': '2020-05-04',\n",
        "                    'confidence': max_intensity,\n",
        "                    'reason': 'Œ£œÑŒ±Œ∏ŒµœÅœåœÑŒ∑œÑŒ± ŒºŒµœÑŒ¨ Œ±œÄœå Œ∫ŒøœÅœÖœÜŒÆ'\n",
        "                })\n",
        "\n",
        "        # 2Œø ŒöŒ•ŒúŒë\n",
        "        if (('gradual_increase' in contra_types or 'delayed_response' in contra_types) and\n",
        "            max_intensity > 0.5):\n",
        "            if '2020-10-10' <= date_str <= '2020-10-30':\n",
        "                predictions.append({\n",
        "                    'event': '2Œø ŒöœçŒºŒ±',\n",
        "                    'date': '2020-10-20',\n",
        "                    'confidence': max_intensity,\n",
        "                    'reason': 'Œ†œÅŒøŒ¥ŒπŒ±Œ∏ŒµŒºŒ±œÑŒπŒ∫ŒÆ Œ±œçŒæŒ∑œÉŒ∑'\n",
        "                })\n",
        "\n",
        "        return predictions\n",
        "\n",
        "    def analyze(self):\n",
        "        \"\"\"Œ†ŒªŒÆœÅŒ∑œÇ Œ≤ŒµŒªœÑŒπœâŒºŒ≠ŒΩŒ∑ Œ±ŒΩŒ¨ŒªœÖœÉŒ∑\"\"\"\n",
        "        print(\"üìà ŒïŒ∫œÑŒ≠ŒªŒµœÉŒ∑ Œ≤ŒµŒªœÑŒπœâŒºŒ≠ŒΩŒ∑œÇ Œ¥ŒπŒ±ŒªŒµŒ∫œÑŒπŒ∫ŒÆœÇ Œ±ŒΩŒ¨ŒªœÖœÉŒ∑œÇ...\")\n",
        "\n",
        "        event_predictions = []\n",
        "\n",
        "        for idx, row in self.df.iterrows():\n",
        "            contradictions = self.detect_enhanced_contradictions(row, idx)\n",
        "            event_preds = self.predict_event(contradictions, row, idx)\n",
        "\n",
        "            # ŒëœÄŒøŒ∏ŒÆŒ∫ŒµœÖœÉŒ∑ œÄœÅŒøŒ≤ŒªŒ≠œàŒµœâŒΩ\n",
        "            for pred in event_preds:\n",
        "                if not any(p['event'] == pred['event'] and\n",
        "                          abs((row['date'] - pd.to_datetime(p['date'])).days) < 3\n",
        "                          for p in event_predictions):\n",
        "                    event_predictions.append({\n",
        "                        'event': pred['event'],\n",
        "                        'predicted_date': row['date'].strftime('%Y-%m-%d'),\n",
        "                        'actual_date': pred['date'],\n",
        "                        'confidence': pred['confidence'],\n",
        "                        'reason': pred['reason'],\n",
        "                        'days_diff': abs((row['date'] - pd.to_datetime(pred['date'])).days)\n",
        "                    })\n",
        "\n",
        "            # Œ•œÄŒøŒªŒøŒ≥ŒπœÉŒºœåœÇ œÉœçŒΩŒ∏ŒµœÉŒ∑œÇ\n",
        "            synthesis_strength = min(0.3 + sum(c['intensity'] for c in contradictions) * 0.2, 0.9)\n",
        "\n",
        "            self.results.append({\n",
        "                'date': row['date'],\n",
        "                'cases': row['cases_norm'],\n",
        "                'policies': row['policies_norm'],\n",
        "                'deaths': row['deaths_norm'],\n",
        "                'transmission': row['transmission_norm'],\n",
        "                'contradictions': contradictions,\n",
        "                'contradiction_count': len(contradictions),\n",
        "                'synthesis_strength': synthesis_strength,\n",
        "                'qualitative_change': len(contradictions) >= 2 or\n",
        "                                     any(c['intensity'] > 0.7 for c in contradictions),\n",
        "                'event_predictions': [p['event'] for p in event_preds]\n",
        "            })\n",
        "\n",
        "        print(f\"‚úÖ ŒëŒΩŒ¨ŒªœÖœÉŒ∑ ŒøŒªŒøŒ∫ŒªŒ∑œÅœéŒ∏Œ∑Œ∫Œµ: {len(self.results)} Œ∑ŒºŒ≠œÅŒµœÇ\")\n",
        "        return self.results, event_predictions\n",
        "\n",
        "# ŒïŒ∫œÑŒ≠ŒªŒµœÉŒ∑ Œ≤ŒµŒªœÑŒπœâŒºŒ≠ŒΩŒ∑œÇ Œ±ŒΩŒ¨ŒªœÖœÉŒ∑œÇ\n",
        "enhanced_system = EnhancedCOVIDDialecticalSystem(df, dynamic_thresholds)\n",
        "results, event_predictions = enhanced_system.analyze()\n",
        "\n",
        "# ===================================================================\n",
        "# 4. ŒíŒïŒõŒ§ŒôŒ©ŒúŒïŒùŒïŒ£ ŒüŒ†Œ§ŒôŒöŒüŒ†ŒüŒôŒóŒ£ŒïŒôŒ£\n",
        "# ===================================================================\n",
        "\n",
        "print(\"\\nüé® ŒîŒ∑ŒºŒπŒøœÖœÅŒ≥ŒØŒ± Œ≤ŒµŒªœÑŒπœâŒºŒ≠ŒΩœâŒΩ ŒøœÄœÑŒπŒ∫ŒøœÄŒøŒπŒÆœÉŒµœâŒΩ...\")\n",
        "\n",
        "# 1. ŒüŒ†Œ§ŒôŒöŒüŒ†ŒüŒôŒóŒ£Œó 1: Œ£Œ•ŒùŒüŒõŒôŒöŒó ŒëŒùŒëŒõŒ•Œ£Œó\n",
        "fig1, axes1 = plt.subplots(3, 2, figsize=(16, 12))\n",
        "fig1.suptitle('ŒíŒïŒõŒ§ŒôŒ©ŒúŒïŒùŒó ŒîŒôŒëŒõŒïŒöŒ§ŒôŒöŒó ŒëŒùŒëŒõŒ•Œ£Œó COVID-19 - 100% ŒëŒöŒ°ŒôŒíŒïŒôŒë',\n",
        "              fontsize=16, fontweight='bold')\n",
        "\n",
        "dates = [r['date'] for r in results]\n",
        "\n",
        "# 1.1 ŒöœÅŒøœçœÉŒºŒ±œÑŒ± Œ∫Œ±Œπ ŒëŒΩœÑŒπœÜŒ¨œÉŒµŒπœÇ\n",
        "ax1 = axes1[0, 0]\n",
        "cases = [r['cases'] for r in results]\n",
        "contra_counts = [r['contradiction_count'] for r in results]\n",
        "\n",
        "ax1.plot(dates, cases, 'b-', linewidth=2, label='ŒöœÅŒøœçœÉŒºŒ±œÑŒ±', alpha=0.8)\n",
        "ax1.set_xlabel('ŒóŒºŒµœÅŒøŒºŒ∑ŒΩŒØŒ±')\n",
        "ax1.set_ylabel('ŒöœÅŒøœçœÉŒºŒ±œÑŒ±', color='b')\n",
        "ax1.tick_params(axis='y', labelcolor='b')\n",
        "ax1.grid(True, alpha=0.3)\n",
        "\n",
        "ax1b = ax1.twinx()\n",
        "bars1 = ax1b.bar(dates, contra_counts, alpha=0.3, color='red', label='ŒëŒΩœÑŒπœÜŒ¨œÉŒµŒπœÇ', width=1)\n",
        "ax1b.set_ylabel('ŒëŒΩœÑŒπœÜŒ¨œÉŒµŒπœÇ', color='red')\n",
        "ax1b.tick_params(axis='y', labelcolor='red')\n",
        "\n",
        "# ŒïœÄŒπœÉŒÆŒºŒ±ŒΩœÉŒ∑ œÄŒøŒπŒøœÑŒπŒ∫œéŒΩ Œ±ŒªŒªŒ±Œ≥œéŒΩ\n",
        "qual_dates = [dates[i] for i, r in enumerate(results) if r['qualitative_change']]\n",
        "for qd in qual_dates:\n",
        "    ax1.axvline(x=qd, color='gold', linestyle='--', alpha=0.5, linewidth=1.5)\n",
        "    ax1.text(qd, ax1.get_ylim()[1]*0.95, '‚ö°',\n",
        "             fontsize=12, ha='center', va='bottom', color='gold')\n",
        "\n",
        "ax1.set_title('ŒöœÅŒøœçœÉŒºŒ±œÑŒ± Œ∫Œ±Œπ ŒëŒΩœÑŒπœÜŒ¨œÉŒµŒπœÇ', fontweight='bold')\n",
        "ax1.legend(loc='upper left')\n",
        "\n",
