        "ax2.set_title('ŒîœÖŒΩŒ±ŒºŒπŒ∫Œ¨ ŒöŒ±œÑœéœÜŒªŒπŒ± ŒëŒΩŒØœáŒΩŒµœÖœÉŒ∑œÇ', fontweight='bold')\n",
        "ax2.grid(True, alpha=0.3)\n",
        "ax2.legend()\n",
        "\n",
        "# 1.3 Œ§œçœÄŒøŒπ ŒëŒΩœÑŒπœÜŒ¨œÉŒµœâŒΩ\n",
