        "             ha='center', va='center', fontsize=12, fontweight='bold')\n",
        "    ax3.set_title('ŒöŒ±œÑŒ±ŒΩŒøŒºŒÆ Œ§œçœÄœâŒΩ ŒëŒΩœÑŒπœÜŒ¨œÉŒµœâŒΩ', fontweight='bold')\n",
        "\n",
        "# 1.4 ŒîŒπŒ±ŒªŒµŒ∫œÑŒπŒ∫ŒÆ Œ£œçŒΩŒ∏ŒµœÉŒ∑\n",
        "ax4 = axes1[1, 1]\n",
