        "# Œ•œÄŒøŒªŒøŒ≥ŒπœÉŒºœåœÇ Œ±Œ∫œÅŒØŒ≤ŒµŒπŒ±œÇ\n",
        "target_events = ['1Œø Lockdown', 'ŒöŒøœÅœÖœÜŒÆ 1ŒøœÖ ŒöœçŒºŒ±œÑŒøœÇ', 'ŒßŒ±ŒªŒ¨œÅœâœÉŒ∑ ŒúŒ≠œÑœÅœâŒΩ', '2Œø ŒöœçŒºŒ±']\n",
